import React from "react";
import { Link } from "react-router-dom";
import "./Styles/Navbar/Navbar.css";
import Logo from "../img/logo.png";

export const Navbar = () => {
  return (
    <div className='navbar'>
        <img src={Logo} alt="InstaLogo" />
        <ul className="nav-menu">
            <li>Sign Up</li>
            <li>Sign In</li>
            <li>Profile</li>
        </ul>
    </div>
  )
}
